import React from 'react'
import Navbar from "./Navbar"
import Header from "./Header"
import Particles from 'react-particles-js';
import { tsParticles } from "tsparticles";
const Frontpage = () => {
    return (
        <>
            <Navbar />  
            <Header />  
           <Particles 
           params={{
               particles:{
                   number:{
                       value:30,
                       density:{
                           enable:true,
                           value_area:900
                       },
                       shape:{
                           type:"square",
                           stroke:{
                               
                           }
                       }
                   }
               }
           }}
           />
        </>
    )
}

export default Frontpage;
